  false,\n\t\"url\": null,\n\t\"notes\": \"The data included in this dataset were
  collected in Sermilik Fjord, located in East Greenland in the Ammassalik district
  close to the town of Tasiilaq. Data collection was conducted by deploying five moorings
  from August 2010 to August 2011. The five moorings were named CM1-SF5, CM2-SF6,
  CM5, SF3, and SF4. Mooring CM1-SF5 was located mid-fjord at a depth of 131m and
  was equipped with a Microcat and Aquadopp. Mooring CM2-SF6 was located next to Mooring
  CM1-SF5 at a depth of 390m. It contained a Microcat, an Aquadopp, and four TidbiT
  temperature loggers. Mooring CM5 was located outside the fjord on the shelf at a
  depth of 262m and was equipped with a Microcat, an Aquadopp, and seven TidbiT temperature
  loggers. Mooring SF3 was located near the glacier at a depth of 13m with a Microcat.
  Mooring SF4 was located near the mouth of the fjord at a depth of 600m and was equipped
  with three Microcats and an Aquadopp.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
